    public static void main(String[] args) {
        int previous = 0;
        int counter = 0;
        int totalones = 0;
        int totalzeros = 0;
        int longstring = 0;
        String total = "";

        for (int i = 0; i < 100; i++) {
            for (int j = 0; j < 100; j++) {
                if (previous == pattern[j + i * 100]) {
                    counter++;
                } else {
                    if (longstring < counter) {
                        longstring = counter;
                    }
                    total = total + counter + ", ";
                    previous = pattern[j + i * 100];
                    counter = 1;
                }
                if (pattern[j + i * 100] == 1) {
                    System.out.print("■");
                    totalones +=1;
                } else {
                    System.out.print("□");
                    totalzeros +=1;
                }
            }
            System.out.println();
        }
        System.out.println(total);
        System.out.println("Total number of 1s is " + totalones + " and the total number of 0s is " + totalzeros);
        System.out.println("The longest uninterrupted string is " + longstring);
    }
